import React, { Fragment } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import { Layout } from 'antd';
import styled from 'styled-components';

import Routes from './Routes';

const StyledHeaderTellor = styled.span`
  color: white;
  font-size: 36px;
`;
const StyledHeaderData = styled.span`
  color: #53f1b6;
  font-size: 36px;
`;

const StyledLayout = styled(Layout)`
  height: 100%;
`;

const App = () => {
  const { Header, Content } = Layout;

  return (
    <Fragment>
      <Helmet defaultTitle="Tellor Dispute Center">
        <meta name="description" content="Tellor Dispute Center" />
      </Helmet>
      <StyledLayout>
        <Header>
          <StyledHeaderTellor>tellor</StyledHeaderTellor>
          <StyledHeaderData>data</StyledHeaderData>
        </Header>
        <Content>
          <Router>
            <Routes />
          </Router>
        </Content>
      </StyledLayout>
    </Fragment>
  );
};

export default App;
